I have incredible sponsors 🙏 

I have worked hard to be a professional trail runner & I have worked hard & taken a lot of time building relationships with the best brands in our sport

@ultimatedirectionusa makes the best running vests in the world. I have also worked with UD to create the Schlarb Shorts (best gear carrying shorts in the world) & the Merino Schlarb shirt. The rest of the UD apparel/gear has evolved to become so good now

@nordarun makes the best trail running shoes, the 001 & now the 002. Norda uses the best materials, design & style, but also stays true to their core values & vision. Norda now has the Norda Fam & 665 (I'm the team manager), which is made up of an unbelievable group of humans

@spring_energy makes the best real food fuel in the world & has an awesome team & owners 

@falkesport has been making the best socks for a long time.  I'm happy to work with Falke, the ultra premium sock brand from Germany 

@leki.trailrunning has always made the best performing high-quality poles for everything

I am proud & happy to be working with & supported by all these brands

