May is the time of year I'm knee to waist deep in wet snow forcing my way up high alpine mountains
I haven't been in the alpine this spring
I'm not focused on getting up high right now. I'm focused on the process of being fast on the trail so I can compete in mountain races 
@lavaredoultratrail
